node.text:
Big fan of the original, pretty big fan of this HITA INK.  The MTL leaves a lot to be desired IMO, but it's not awful.  The coil heads aren't different from the original, but the original gave me a much better MTL somehow. 

It's a small little banger that managed to remain on my desk for a while now, and I don't see it going anywhere anytime soon.  As for the graphics on them, ehhhhh I can take em or leave em.  They are real "tattoo-ish" which appeals to me, but I could see not everyone enjoying them.  Thankfully they also do the vapers favorite color scheme, black on black. 

